import React from 'react'
import styles from "./sideimage.module.css"
const SideImage = () => {
  return (
    <div
      style={{
        width: "40%",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <div>
        <SideImage />
      </div>
    </div>
  );
}

export default SideImage
